    false,nt"url": null,nt"notes": "This narrative report for Squaw Creek National
    Wildlife Refuge outlines Refuge accomplishments for August through October of 1940.
    The report begins by summarizing the weather conditions, water conditions, food
    and cover, and wildfires during this period. Wildlife- including migratory birds,
    upland game birds, furbearers, predators, rodents, and fish- is also covered. The
    Refuge development and maintenance section discusses physical developments, plantings,
    and collections and receipts. The public relations section of the report describes
    recreational uses, fishing, and Refuge visitors. Photographs are attached.",nt"owner_org":
